import React from 'react';
import image from "../../resources/images/footer.png"

const Footer = () => {
    return(

        <footer className="footer">
            <div className="image">

                <img src={image} alt="shape" className="illustration"></img>
            </div>

        </footer>
    )
}

export default Footer;
